import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./Home";
import { AddCart } from "./Cart";
import Footer from "./Footer";

function App({ search, cat, setValue }) {
  return (
    <div>
      {/* <h1> Welcome to Our Shopping Website</h1> */}
      <Router>
        <nav className="navbar navbar-expand-lg bg-body-info fs-5">
          <div className="container-fluid">
            <a className="navbar-brand" href="#">
              <img
                src="https://www.zarla.com/images/zarla-our-kitchen-1x1-2400x2400-20210607-g7q69ybhqxvvy7rtwvvj.png?crop=1:1,smart&width=250&dpr=2"
                height="100px"
                alt=""
              />
            </a>
            <button
              className="navbar-toggler"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#navbarSupportedContent"
              aria-controls="navbarSupportedContent"
              aria-expanded="false"
              aria-label="Toggle navigation"
            >
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarSupportedContent">
              <ul className="navbar-nav me-auto mb-2 mb-lg-0 mx-5">
                <form className="d-flex" onSubmit={search}>
                  <input
                    className="form-control ms-5 me-1"
                    type="text"
                    onChange={(e) => setValue(e.target.value)}
                    placeholder="Search your product"
                  />
                  <button className="btn btn-outline-success" type="submit">
                    Search
                  </button>
                </form>
              </ul>
              <span className="navbar-text mx-5 d-flex">
                <div className="nav-item">
                  <a className="nav-link mx-5" href="#">
                    <i className="bi bi-cart-plus-fill h3"></i>
                    <span className="position-absolute top-7 start-70 fs-6 translate-middle badge rounded-pill bg-danger">
                      {/* {count.length} */}
                      {cat}
                      <span className="visually-hidden"></span>
                    </span>
                  </a>
                </div>
                <a className="nav-link">
                  <i className="bi bi-person-circle" style={{ fontSize: "20px" }}></i>
                  User
                </a>
              </span>
              <div className="d-flex" role="search">
                <button className="btn btn-outline-success" type="submit">
                  Logout
                </button>
              </div>
            </div>
          </div>
        </nav>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/cart" element={<AddCart />} />
        </Routes>
      </Router>
      <div>
        <Footer />
      </div>
    </div>
  );
}

export default App;
